Problem cannot be reproduced in base Eclipse platform. Dispose is called more 
than once. From the stack trace it is diffcult to track down which view caused 
the problem, all you can see is that it is a TreeViewer. The double delete can 
be a consequence of calling ContentViewer.setLabelProvider() twice with the 
same LabelProvider (this bug has occurred before, but is fixed in the base 
eclipse).

Made the following changes to avoid this problem in JDT code
- PackageExplorerPart
     make setLabelDecorator a no-op. This call is not supported anymore, it
     was used to add VCM decorations before the 2.0 Decorator solution and it 
     can set the label provider. This change is consistent with Navigator, there
     this method is now also a no-op.

- StorageLabelProvider
     protect it against double deletes. There will be no more crashes. The 
     symptoms of a double delete are that icons for non-Java resources inside
     JARs will not show up.

Suggest to make the call ContentViewer.setLabelProvider() robust against 
calling it twice with the same LabelProvider. Currently, the label provider is 
disposed when it is set the second time (see *** below). Moving to Platform UI 
for consideration.

public void setLabelProvider(IBaseLabelProvider labelProvider) {
	IBaseLabelProvider oldProvider = this.labelProvider;
	if (oldProvider != null) {
		oldProvider.removeListener(this.labelProviderListener);
	}
	this.labelProvider = labelProvider;
	if (labelProvider != null) {
		labelProvider.addListener(this.labelProviderListener);
	}
	refresh();

	// Dispose old provider after refresh, so that items never refer to 
stale images.
	if (oldProvider != null) {
****		oldProvider.dispose();
	}
}
